var settings = {
        colors: ['#00A676', '#E9E3E6', '#3C91E6', '#393D3F', '#FE6D73'],
        scoreChangeTime: 500,
        zoomOutSpeed: 500,
        zoomInSpeed: 500,
        dropSpeed: 500,
        levelNumber: 3,
        supertileActivationNumber: 2,
        fieldblastActivationNumber: 5,
        levels: {
            0: {
                id: 0,
                rows: 7,
                cols: 5,
                minBlastCount: 2,
                moves: 10,
                shuffles: 1,
                get colorNumber() {
                    return Math.floor(4 + this.id / 2)
                },
                get goal() {
                    return 300 + this.id * 40
                },
            },
            1: {
                id: 1,
                rows: 7,
                cols: 5,
                minBlastCount: 2,
                moves: 10,
                shuffles: 1,
                get colorNumber() {
                    return Math.floor(4 + this.id / 2)
                },
                get goal() {
                    return 300 + this.id * 40
                },
            },
            2: {
                id: 2,
                rows: 7,
                cols: 5,
                minBlastCount: 2,
                moves: 10,
                shuffles: 2,
                get colorNumber() {
                    return Math.floor(4 + this.id / 2)
                },
                get goal() {
                    return 300 + this.id * 40
                },
            },
        }
    },

    Nodes = {
        game: document.getElementById('game'),
        progressInner: document.getElementById('progress-inner'),
        fieldWrapper: document.getElementById('field-wrapper'),
        field: document.getElementById('field'),
        score: document.getElementById('score'),
        movesLeft: document.getElementById('moves-left'),
        goal: document.getElementById('goal'),
        shuffles: document.getElementById('shuffles-left'),
        nextButton: document.getElementById('next-button'),
        retryButton: document.getElementById('retry-button'),
        restartButton: document.getElementById('restart-button'),
        shuffleButton: document.getElementById('shuffle-button'),
    },

    images = {
        tile0: 'data:image/png;base64,',
        tile1: 'data:image/png;base64,',
        tile2: 'data:image/png;base64,',
        tile3: 'data:image/png;base64,',
        tile4: 'data:image/png;base64,',
        starH: 'data:image/png;base64,',
        starV: 'data:image/png;base64,',
        starAll: 'data:image/png;base64,',
    },

    loadedImages = {},
    ctx,
    cw,
    ch,
    ctxBounds,
    tiles = [],
    tileWidth,
    tileHeight,
    blastCount,
    blastMatrix,
    blastExtremePoints = {x1: 0, x2: 0, y1: 0, y2: 0},
    moveExists = false,
    tilesWillDrop = false,
    level = 0,
    score = 0,
    scoreInterval,
    movesLeft,
    shufflesLeft,
    controlsDisabled = false;

function start() {
    loadImages(images, function () {
        startLevel();
        addEventListeners();
        animateTiles();

        setTimeout(function () {
            Nodes.game.classList.remove('loading');
        }, 500);
    })
}

function startLevel() {
    if (tiles.length > 0) {
        blastArea(null, true);
    }
    score = 0;
    shufflesLeft = settings.levels[level].shuffles;
    createField();
    setCounters();
    Nodes.game.classList.remove('win', 'lose', 'super-win', 'no-shuffles');
    controlsDisabled = false;
}

function createField() {
    var row, col;

    ctx = Nodes.field.getContext('2d');
    cw = Nodes.fieldWrapper.getBoundingClientRect().width;
    tileWidth = cw / settings.levels[level].cols;
    tileHeight = tileWidth / 0.89;
    ch = tileHeight * settings.levels[level].rows;
    Nodes.field.width = cw;
    if (Nodes.field.height < ch) {
        Nodes.field.height = ch;
    }
    ctxBounds = Nodes.field.getBoundingClientRect();

    for (row = 0; row < settings.levels[level].rows; row++) {
        if (!tiles[row]) tiles[row] = [];
        for (col = 0; col < settings.levels[level].cols; col++) {
            generateTile(row, col);
        }
    }
}

function loadImages(images, callback) {
    var src, imgLoaded = 0, imgCount = 0;
    for (src in images) {
        imgCount++;
    }
    for (src in images) {
        loadedImages[src] = new Image();
        loadedImages[src].onload = function () {
            if (++imgLoaded >= imgCount) {
                callback(images);
            }
            Nodes.progressInner.style.width = 100 / imgCount * imgLoaded + '%';
        };
        loadedImages[src].src = images[src];
    }
}

function addEventListeners() {
    Nodes.field.addEventListener('click', function (e) {
        if (controlsDisabled) return;
        clickTile(e.clientX - ctxBounds.left, e.clientY - ctxBounds.top);
    })

    Nodes.nextButton.addEventListener('click', function () {
        level++;
        startLevel();
    })
    Nodes.retryButton.addEventListener('click', function () {
        startLevel();
    })
    Nodes.restartButton.addEventListener('click', function () {
        level = 0;
        startLevel();
    })
    Nodes.shuffleButton.addEventListener('click', function () {
        if (controlsDisabled) return;
        shuffleField();
        findMove();
        if (!moveExists) {
            Nodes.game.classList.add('lose', 'no-shuffles');
            controlsDisabled = true;
        }
    })
}

function animateTiles() {
    var row, col;
    ctx.clearRect(0, 0, cw, ch);

    for (row = 0; row < settings.levels[level].rows; row++) {
        for (col = 0; col < settings.levels[level].cols; col++) {
            if (tiles[row] && tiles[row][col]) {
                tiles[row][col].update();
            }
        }
    }

    requestAnimationFrame(animateTiles);
}